import React,{Component} from 'react'
import { BrowserRouter as Router,Switch,Route,withRouter,Link } from 'react-router-dom'
import ShowData from './ShowData'
class NewsList extends  Component{
	handleDisplay = () => {
		this.props.history.push("/hello")
		return this.data
	}

	render(){
		const {urlToImage} = this.props.news
		return(
			<Router>
				<div className="col-sm-4 col-md-4 col-xl-4 col-lg-4">
					<figure className="figure">
						<button onClick={this.handleDisplay} ><img  src={urlToImage}   data-toggle="modal" data-target="#exampleModalLong"   width="70%" height="60%" className="img-fluid  rounded"  alt="Data not found"/></button>
					</figure>

					 <Route path="/hello" render={()=><ShowData />} />

				</div>
			</Router>
		)
	}
}
export default withRouter(NewsList)
